    @classmethod
    def pldaInput(cls) -> np.ndarray:
        """
        Prepares extracted x-vectors for PLDA scoring by subtracting global mean,
        applying the whitening transform and then normalizing lengths to be the
        sqrt of the x-vector dimension.
        """
        # Stacking all extracted x-vectors in the ark. Shape = (512, 29).
        xvecs = np.stack(list(cls.ark.values()), axis=0)
        
        # Adding an extra axis at the end for matmuls.
        xvecs = np.expand_dims(xvecs, axis=-1)

        # Subtracting global mean and applying whitening transform.
        xvecs = np.subtract(xvecs, cls.mean.reshape((cls.dim, 1)))
        xvecs = np.matmul(cls.whiteningMat, xvecs)

        # Normalizing length of x-vectors to be equal to sqrt(dim)
        norm = np.linalg.norm(xvecs, ord=2, axis=1, keepdims=True)
        ratio = np.divide(norm, np.sqrt(cls.dim))
        xvecs = np.divide(xvecs, ratio)

        return xvecs

    @classmethod
    def pldaTransformed(cls, withoutPCA=True) -> np.ndarray:
        """
        Stacks the reference x-vectors that have been transformed by the PLDA model
        and returns them as a single 3D numpy array with shape (batch, dim, 1).
        """
        if withoutPCA:
            xvecs = np.stack(list(cls.arkPldaTransformedWithoutPCA.values()), axis=0)
        else:
            raise NotImplementedError
 
        xvecs = np.expand_dims(xvecs, axis=-1)

        return xvecs

